import React from 'react';

function About() {
    return (
        <section className="container">
            <h2 className="row">About Me</h2>
            <div className="row">
                <img className="col-md-5 img-fluid rounded-circle w-25" src={require('../../assets/images/headshot.jpg')} alt='Headshot'/>
                <p className="col-md-7">
                    Example bio paragraph about me
                </p>    
            </div>

        </section>
    )
}

export default About;
